mapper.select:
select count(0) from trans_busi_data


		and name like CONCAT('%', #{search,jdbcType=VARCHAR}, '%')


		and type = #{type,jdbcType=VARCHAR}


		and `rank`  <=  #{rank,jdbcType=TINYINT} 


		and (business_id = #{businessId,jdbcType=BIGINT} 
			or id = #{businessId,jdbcType=BIGINT}) 


		and group_id = #{groupId,jdbcType=BIGINT}


		and channel_info_id = #{channelInfoId,jdbcType=BIGINT} 


		and device_id = #{deviceId,jdbcType=BIGINT} 


		and name like CONCAT('%', #{name,jdbcType=VARCHAR}, '%')


		and transmit_model like CONCAT('%', #{transmitModel,jdbcType=VARCHAR}, '%')


		and work_state = #{workState,jdbcType=TINYINT}


		and approval_state = #{approvalState,jdbcType=TINYINT}

select 
from trans_busi_data


		and name like CONCAT('%', #{search,jdbcType=VARCHAR}, '%')


		and type = #{type,jdbcType=VARCHAR}


		and `rank`  <=  #{rank,jdbcType=TINYINT} 


		and (business_id = #{businessId,jdbcType=BIGINT} 
			or id = #{businessId,jdbcType=BIGINT}) 


		and group_id = #{groupId,jdbcType=BIGINT}


		and channel_info_id = #{channelInfoId,jdbcType=BIGINT} 


		and device_id = #{deviceId,jdbcType=BIGINT} 


		and name like CONCAT('%', #{name,jdbcType=VARCHAR}, '%')


		and transmit_model like CONCAT('%', #{transmitModel,jdbcType=VARCHAR}, '%')


		and work_state = #{workState,jdbcType=TINYINT}


		and approval_state = #{approvalState,jdbcType=TINYINT}


order by gmt_create desc, id desc

 	select 
 	from trans_busi_data where business_id = #{businessId,jdbcType=BIGINT} 

		and type = #{type,jdbcType=VARCHAR}

 	select 
 	from trans_busi_data where 1 = 1 and type != 'recSender' 

		and transmit_data_id = #{transmitDataId,jdbcType=BIGINT}


		and strategy_qos_id = #{strategyQosId,jdbcType=BIGINT}


		and business_time_id = #{businessTimeId,jdbcType=BIGINT}

select 
from trans_busi_data where type = #{type,jdbcType=VARCHAR}
and transmit_data_id = #{transmitDataId,jdbcType=BIGINT} 
limit 1

select 
from trans_busi_data where channel_info_id = #{channelInfoId,jdbcType=BIGINT} 
and type = #{type,jdbcType=VARCHAR} 
and transmit_model like CONCAT('%', #{transmitModel,jdbcType=VARCHAR}, '%')

select 
from trans_busi_data where type = #{type,jdbcType=VARCHAR}
and strategy_spice_id = #{strategySpiceId,jdbcType=BIGINT} 
limit 1

select from trans_busi_data where 1 = 1
and type = #{type,jdbcType=VARCHAR}
and approval_state = #{approvalState,jdbcType=TINYINT}
and transmit_model like CONCAT('%', #{transmitModel,jdbcType=VARCHAR}, '%')
and type != 'recSender' and type != 'recSenderDouble'

mapper.update:
update trans_busi_data
set group_id = null 
where group_id = #{groupId,jdbcType=BIGINT}
